import React from "react";

export default function RenderNames()
{
    const[names, setNames]  = ["Georgi","Pesho", "Dido", "Nikola", "Asparuh"];

    function handleDelete(id)
    {
        console.log(5);
        console.log(names);
        names.splice(id,2);
    }
    return(
        <>
            <table>
                <tr>
                    <th>Name</th>
                    
                </tr>
                    {names.map((name, i) =><tr><td><p onClick={() =>handleDelete(i)} key={i}>{name}</p></td></tr>)}
            </table>
        </>
    )
}
